function correctImgTagClosure(htmlString) {
    // 正则表达式匹配未正确闭合的<img>标签
    // 注意：这个正则表达式是简化的，可能无法处理所有复杂的HTML情况
    const imgTagRegex = /<img\s+([^>]*)>/g;
    const brTagRegex = /<br>/g;
    const nbspTagRegex = /&nbsp;/g;

    htmlString = htmlString.replace(brTagRegex, '<br/>');

    // 使用替换函数来修正标签
    return htmlString.replace(imgTagRegex, (match, attributes) => {
    //    // 如果标签没有以/>结束，则添加它
        if (!match.endsWith('/>')) {
            return `<img ${attributes}/>`;
        }
        // 如果已经是正确的闭合标签，则保持不变
        return match.replace('.png">','.png"/>').replace('.jpg">','.jpg"/>');
    });
    htmlString = htmlString.replace('.png">','.png"/>').replace('.jpg">','.jpg"/>')
    return htmlString;
}
